import React from 'react';
import '../Body.css';
import './AddNewReservation.css';
import Header from '../../Components/Header/Header';
import Footer from '../../Components/Footer/Footer';

export default function AddNewReservation (){

    return(

        <div>

            <Header />

            <div className='body add-new-reservation'>

                <div className='add-new-reservation-content'>

                    <p>New Reservation</p>

                   <input type="text" placeholder='test'/>

                   <label className='startdate' for="enddate">Start Date:</label>
                   <input type="date" id="startdate" name="startdate" placeholder='Start Date' />

                    <label className='enddate' for="fname">End Date:</label>
                    <input type="date" id="enddate" name="enddate" placeholder='End Date' />
                </div>

            </div>

            <Footer />

        </div>

    )

}
